import React from 'react';
// import { Link } from 'react-router-dom';

import { Container, Content } from './styles';

const Header: React.FC = () => {
    return (
        <Container>
        <Content>
                <nav>
            <ul>
                        <li>Pagina Inicial</li>
                      <li>Como Somos</li>
                        <li>Quem Somos</li>
                        <li>Area do Logista</li>
                    </ul>
          </nav>
            </Content>
      </Container>
    );
};

export default Header;
